function agregarTabla(datos,tabla) {
    var db = appSqlite.db; 
    db.transaction(function (tx) {
        for (var i = 0; i < datos.length; i++) {
			switch(tabla){ 
			   case 'departamento':
					tx.executeSql("INSERT INTO departamento(id, DPTOCOD, PAICOD, DPTODES) VALUES (?,?,?,?)", [datos[i].id, datos[i].DPTOCOD, datos[i].PAICOD, datos[i].DPTODES], onSuccess, onError);                       
               break;
               case 'provincia':
					tx.executeSql("INSERT INTO provincia(id, PROVCOD, PAICOD, DPTOCOD, PROVDES) VALUES (?,?,?,?,?)", [datos[i].id, datos[i].PROVCOD, datos[i].PAICOD, datos[i].DPTOCOD, datos[i].PROVDES], onSuccess, onError);
               break;
               default://distrito
				     tx.executeSql("INSERT INTO distrito(id, DISTCOD, PAICOD, DPTOCOD, PROVCOD, DISTDES) VALUES (?,?,?,?,?,?)", [datos[i].id, datos[i].DISTCOD, datos[i].PAICOD, datos[i].DPTOCOD, datos[i].PROVCOD, datos[i].DISTDES], onSuccess, onError);
               break;
			}
        }
    });
}

function onError(tx, e) {
    console.log("Error: " + e.message);
}

